import React from "react";

export function Link({ href, children }) {
    return (
            <li>
                <a href={href}>{children}</a>
            </li>
    )
}

export function Menu() {
    return (
        <ul className="menu">
            <Link href="/">Home</Link>
            <Link href="/">Portofolio</Link>
            <Link href="/">Contato</Link>
        </ul>
    );
}

export function Home() {
    return (
        <div>
            <header>
                <Menu/>
            </header>
        </div>
    );
}
